import React from 'react';
import Header from './comp/header.js';
import Elemento from './comp/elemento.js';
import Botonmas from './comp/botonmas.js';
import './styles/App.css';

function App() {
  return (
    <div className="App">
      <Header />
      <Elemento />
      <hr id="divisor"/>
      <Botonmas />
    </div>
  );
}

export default App;
